import React from 'react';
import NavBar from "./components/layout/Navbar";
import Footer from "./components/layout/Footer";

function App() {
  return (
    <div className="App">
      <NavBar />
      <div className="header"></div>
      <div className="main"></div>
      <Footer />
    </div>
  );
}

export default App;
